import React from "react";
import {NavLink, Link, Outlet} from 'react-router-dom';
import './navbar.css';

export default function NavBar()
{
    // display: flex;
    // max-height: 90px;
    // justify-content: space-between;
    // background-color: slategrey;
    // color: whitesmoke;
    let navStyle = {
       
    }
    let divStyle = {
        display: "flex",
        // flexDirection: "row-reverse",
        // float: "right",
        justifyContent: "space-between",
        margin: "15px",
        width: "25%",
        /* color: whitesmoke; */
        display: "flex",
        fontSize: "20px",
}
    
    // let h3Style = {
    //     margin: "10px",
    // }
    let aStyle = {
        color: "whitesmoke",
        textDecoration: "none",
    }
    return (
        <div>
            <nav style = {navStyle}>
                <Link to = "/" style={aStyle}><div style={divStyle}><img className = "nav--logo" src="" alt="Logo"/><h2>Dhanwantari Vaid Mandal</h2></div></Link>
                <div style={divStyle}>
                    <NavLink to="/" style={aStyle}>Home</NavLink>
                    <NavLink to="/blogs" style={aStyle}>Blogs</NavLink>
                    <NavLink to="/contact" style={aStyle}>Contacts</NavLink>
                    <NavLink to="/about" style={aStyle}>About</NavLink>
                </div>
            </nav>
            <Outlet/>
        </div>
    )
}
